import React from "react";
import myImage from '../assets/image 1.png'; // Adjusted path to match the directory structure
import './Header.css'
function Header() {
  return (
    <div className="Par">

      <img className="ImgLogo" src={myImage} alt="My Image" />
      <button className="logoutbtn">LogOut</button>
    </div>
  );
}

export default Header;
